SCTX:
Begin karrodMovement

short doOnce
float timer
short moveOnce
short moveCounter
short tienMove
short helsMove
short ivulMove
short evoMove
short drusMove
short diraMove
short resetOnce
float fighttimer
short initialized
short startday
short starthour

if ( MenuMode == 1 )
	return
endif

if ( initialized == 0 )
	set initialized to 1
	set startday to DaysPassed
	set starthour to GameHour
endif

if ( GetJournalIndex TR_Champion >= 80 )
	if ( resetOnce == 0 )
		AiWander 2000 1 0 60 20 10 10 0 0 0 0 0
		set resetOnce to -1
	endif
endif

if ( moveOnce == -1 )
	return
endif

if ( GetJournalIndex TR_Champion == 20 )
	if ( KarrodFightStart == 0 )
		if ( GetPCCell "Mournhold, Royal Palace Throne Room" != 1 )
			;when player leaves room, send Karrod to bar
			Karrod->PositionCell -37.431 180.252 134.399 180 "Mournhold, The Winged Guar"
			Set KarrodFightStart to 1
		endif
	endif
endif

;wait for one day to pass
if ( KarrodFightStart < 2 )
	if ( DaysPassed < ( startday + 1 ) )
		if ( DaysPassed <= startday )
			return
		endif
		if ( GameHour <= starthour )
			return
		endif
	endif	
endif

;if karrod at bar...
if ( KarrodFightStart == 1 )
	;...do not move him back if PC is at bar
	if ( GetPCCell "Mournhold, The Winged Guar" == 1 )
		return
	endif

	;...do not move him back if PC in throne room
	if ( GetPCCell "Mournhold, Royal Palace Throne Room" == 1 )
		return
	endif

	;...otherwise, move him back and prep for fight
	if ( doOnce == 0 )
		Karrod->PositionCell 111.062 -76.603 -68.484 0 "Mournhold, Royal Palace Throne Room" 
		set KarrodFightStart to 2
		set doOnce to 1
	endif
else
	;...otherwise, just prep for fight
	if ( doOnce == 0 )
		set KarrodFightStart to 2
		set doOnce to 1
	endif
endif

;wait until helseth starts fight
if ( KarrodFightStart < 3 )
	return
endif


;***THIS SECTION WILL MOVE EVERYONE ELSE IN THE ROOM OUT OF THE WAY AND MAKE HELSETH YELL "GO!'

if ( moveOnce == 0 )
	if ( KarrodFightStart == 3 )
		"Tienius Delitian"->AiTravel 591.54 246.32 -116
		"King Hlaalu Helseth"->AiTravel -260 -560 -116
		"Ivulen Irano"->AiTravel 591.54 -31.56 -116
		"Evo Othreloth"->AiTravel 100 580 -116
		"Drusus Gratus"->AiTravel -100 580 -116
		"Diradeni Farano"->AiTravel -571.39 1.03 -116
		set moveOnce to 1
	endif
endif

if ( moveOnce == 2 )
	"King Hlaalu Helseth"->Say "Vo\Misc\duelbegin.wav", "Let the duel begin!"
	AiWander 0 0 0 0 0 0
	karrod->StartCombat Player
	set moveOnce to -1
	StopScript KarrodMovement
endif


if ( moveCounter >= 6 )
	if ( moveOnce == 1 )
		if ( fighttimer < 1 )
			set fighttimer to fighttimer + GetSecondsPassed
			return
		endif
		set moveOnce to 2
	endif
endif

if ( moveOnce == 1 )
	if ( tienMove == 0 )
		if ( "Tienius Delitian"->GetAiPackageDone == 1 )
			"Tienius Delitian"->Face 0 0 -116
			set tienMove to 1
		endif
	endif
endif

if ( moveOnce == 1 )
	if ( helsMove == 0 )
		if ( "King Hlaalu Helseth"->GetAiPackageDone == 1 )
			"King Hlaalu Helseth"->Face 0 0 -116
			set helsMove to 1
		endif
	endif
endif

if ( moveOnce == 1 )
	if ( ivulMove == 0 )
		if ( "Ivulen Irano"->GetAiPackageDone == 1 )
			"Ivulen Irano"->Face 0 0 -116
			set ivulMove to 1
		endif
	endif
endif

if ( moveOnce == 1 )
	if ( evoMove == 0 )
		if ( "Evo Othreloth"->GetAiPackageDone == 1 )
			"Evo Othreloth"->Face 0 0 -116
			set evoMove to 1
		endif
	endif
endif

if ( moveOnce == 1 )
	if ( drusMove == 0 )
		if ( "Drusus Gratus"->GetAiPackageDone == 1 )
			"Drusus Gratus"->Face 0 0 -116
			set drusMove to 1
		endif
	endif
endif

if ( moveOnce == 1 )
	if ( diraMove == 0 )
		if ( "Diradeni Farano"->GetAiPackageDone == 1 )
			"Diradeni Farano"->Face 0 0 -116
			set diraMove to 1
		endif
	endif
endif

if ( moveCounter < 6 )
	if ( moveOnce == 1 )
		if ( tienMove == 1 )
			if ( "Tienius Delitian"->GetAiPackageDone == 1 )
				set tienMove to -1
				set moveCounter to ( moveCounter + 1 )
			endif
		endif
	endif
endif

if ( moveCounter < 6 )
	if ( moveOnce == 1 )
		if ( helsMove == 1 )
			if ( "King Hlaalu Helseth"->GetAiPackageDone == 1 )
				set helsMove to -1
				set moveCounter to ( moveCounter + 1 )
			endif
		endif
	endif
endif

if ( moveCounter < 6 )
	if ( moveOnce == 1 )
		if ( ivulMove == 1 )
			if ( "Ivulen Irano"->GetAiPackageDone == 1 )
				set ivulMove to -1
				set moveCounter to ( moveCounter + 1 )
			endif
		endif
	endif
endif

if ( moveCounter < 6 )
	if ( moveOnce == 1 )
		if ( evoMove == 1 )
			if ( "Evo Othreloth"->GetAiPackageDone == 1 )
				set evoMove to -1
				set moveCounter to ( moveCounter + 1 )
			endif
		endif
	endif
endif

if ( moveCounter < 6 )
	if ( moveOnce == 1 )
		if ( drusMove == 1 )
			if ( "Drusus Gratus"->GetAiPackageDone == 1 )
				set drusMove to -1
				set moveCounter to ( moveCounter + 1 )
			endif
		endif
	endif
endif

if ( moveCounter < 6 )
	if ( moveOnce == 1 )
		if ( diraMove == 1 )
			if ( "Diradeni Farano"->GetAiPackageDone == 1 )
				set diraMove to -1
				set moveCounter to ( moveCounter + 1 )
			endif
		endif
	endif
endif

if ( moveOnce == 2 )
	if ( tienmove == -1 )
		"Tienius Delitian"->AiWander 0 0 0 0 0 0
		set tienmove to -2
	endif

	if ( helsmove == -1 )
		"King Hlaalu Helseth"->AiWander 0 0 0 0 0 0
		set helsmove to -2
	endif

	if ( ivulmove == -1 )
		"Ivulen Irano"->AiWander 0 0 0 0 0 0
		set ivulmove to -2
	endif
	
	if ( evomove == -1 )
		"Evo Othreloth"->AiWander 0 0 0 0 0 0
		set evomove to -2
	endif

	if ( drusmove == -1 )
		"Drusus Gratus"->AiWander 0 0 0 0 0 0
		set drusmove to -2
	endif
	
	if ( diramove == -1 )
		"Diradeni Farano"->AiWander 0 0 0 0 0 0
		set diramove to -2
	endif
endif


End karrodMovement
